import React from 'react';
import '/css/Main.css';

const Main = () => {
    return (
        <div className="main-container">
            <button className="main-button">거리 순 기준 선택</button>
            <button className="main-button">혼잡도 기준 선택</button>
            <button className="main-button">지도 기준 선택</button>
        </div>
    );
};

export default Main;
